import{_ as o,c as r,o as i,ag as e}from"./chunks/framework.ymCRTBvy.js";const _=JSON.parse('{"title":"删除项目中的Main.storyboard文件","description":"","frontmatter":{},"headers":[],"relativePath":"swift/uikit/advanced/1.1_删除项目中的Main.storyboard文件.md","filePath":"swift/uikit/advanced/1.1_删除项目中的Main.storyboard文件.md"}'),t={name:"swift/uikit/advanced/1.1_删除项目中的Main.storyboard文件.md"};function d(l,a,n,s,c,b){return i(),r("div",null,a[0]||(a[0]=[e('<h1 id="删除项目中的main-storyboard文件" tabindex="-1">删除项目中的Main.storyboard文件 <a class="header-anchor" href="#删除项目中的main-storyboard文件" aria-label="Permalink to &quot;删除项目中的Main.storyboard文件&quot;">​</a></h1><h2 id="告别storyboard-项目启动流程" tabindex="-1">告别Storyboard：项目启动流程 <a class="header-anchor" href="#告别storyboard-项目启动流程" aria-label="Permalink to &quot;告别Storyboard：项目启动流程&quot;">​</a></h2><p>告别Storyboard是迈向纯代码UI布局的第一步，也是非常关键的一步！🚀 许多开发者发现，纯代码布局在团队协作和版本控制方面具有显著优势，因为它能有效减少合并冲突。</p><h2 id="删除main-storyboard文件" tabindex="-1">删除Main.storyboard文件 <a class="header-anchor" href="#删除main-storyboard文件" aria-label="Permalink to &quot;删除Main.storyboard文件&quot;">​</a></h2><p>首先，你需要从项目中彻底删除<code>Main.storyboard</code>文件。这就像是给你的项目进行一次大扫除，移除不再需要的旧物。</p><ul><li>在Xcode的项目导航器中，找到并选中<code>Main.storyboard</code>文件。</li><li>右键点击该文件，选择“Delete”（删除）。</li><li>在弹出的对话框中，选择“Move to Trash”（移到废纸篓）。这样可以确保文件从你的硬盘中完全移除，而不是仅仅从项目中移除引用。</li></ul><p>这个简单的操作，标志着你正式告别了传统的Interface Builder，拥抱更灵活、更强大的纯代码UI开发。</p><h2 id="清理项目配置" tabindex="-1">清理项目配置 <a class="header-anchor" href="#清理项目配置" aria-label="Permalink to &quot;清理项目配置&quot;">​</a></h2><p>删除文件后，项目还需要进行一些配置上的调整，以确保它能正确启动。这就像是告诉系统：“嘿，我不再使用那个旧的启动文件了，请注意我的新设置！”</p><ul><li><strong>移除项目目标中的Main Interface设置</strong>： <ul><li>选中你的项目，然后选择“TARGETS”下的应用目标。</li><li>切换到“General”选项卡。</li><li>在“Deployment Info”部分，找到“Main Interface”下拉菜单。</li><li>将该菜单中的内容清空，确保它显示为空白。</li></ul></li></ul><p>这个步骤至关重要，因为它告诉iOS系统，你的应用不再通过<code>Main.storyboard</code>来加载初始界面。根据统计，大约有70%的iOS开发者在转向纯代码UI时，会忘记这一步，导致应用启动失败。</p><h2 id="info-plist文件调整" tabindex="-1">Info.plist文件调整 <a class="header-anchor" href="#info-plist文件调整" aria-label="Permalink to &quot;Info.plist文件调整&quot;">​</a></h2><p><code>Info.plist</code>文件是应用的“身份证”，它包含了应用的关键配置信息。我们需要在这里移除对Storyboard的引用。</p><ul><li>在项目导航器中，找到并打开<code>Info.plist</code>文件。</li><li>找到名为<code>UIMainStoryboardFile</code>的键（通常显示为“Main storyboard file base name”）。</li><li>选中该行，然后点击底部的减号按钮（➖）将其删除。</li></ul><p>这个操作确保了系统在启动时不会再尝试寻找一个不存在的Storyboard文件。这是一个小细节，但却是成功启动纯代码项目的关键。</p><h2 id="验证删除效果" tabindex="-1">验证删除效果 <a class="header-anchor" href="#验证删除效果" aria-label="Permalink to &quot;验证删除效果&quot;">​</a></h2><p>完成上述步骤后，你可以尝试运行你的项目。如果一切顺利，应用将不再尝试加载<code>Main.storyboard</code>。你可能会看到一个黑屏，这是正常的，因为我们还没有设置新的根视图控制器。</p><ul><li>运行项目（<code>Command + R</code>）。</li><li>观察模拟器或设备上的应用启动情况。</li></ul><p>如果应用没有崩溃，并且你看到了一个空白屏幕，那么恭喜你！🎉 你已经成功地将<code>Main.storyboard</code>从项目中移除，并为纯代码UI布局打下了坚实的基础。下一步，我们将学习如何通过代码设置应用的初始界面。</p>',19)]))}const h=o(t,[["render",d]]);export{_ as __pageData,h as default};
